lication\":\"erahub-base\",\"background\":\"false\",\"dynamic\":\"true\",\"anyhost\":\"true\"},\"path\":\"com.erahub.base.basicservice.api.RemoteSmsService\",\"port\":20880,\"protocol\":\"dubbo\"},\"com.erahub.base.system.api.RemoteDataScopeService:dubbo\":{\"name\":\"com.erahub.base.system.api.RemoteDataScopeService\",\"params\":{\"side\":\"provider\",\"release\":\"3.1.4\",\"methods\":\"getDeptAndChild,getRoleCustom\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"dubbo\":\"2.0.2\",\"interface\":\"com.erahub.base.system.api.RemoteDataScopeService\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"generic\":\"false\",\"metadata-type\":\"remote\",\"application\":\"erahub-base\",\"background\":\"false\",\"dynamic\":\"true\",\"anyhost\":\"true\"},\"path\":\"com.erahub.base.system.api.RemoteDataScopeService\",\"port\":20880,\"protocol\":\"dubbo\"},\"com.erahub.base.basicservice.api.RemoteFileService:dubbo\":{\"name\":\"com.erahub.base.basicservice.api.RemoteFileService\",\"params\":{\"side\":\"provider\",\"release\":\"3.1.4\",\"methods\":\"clearTempFiles,deleteByIds,deleteByUrls,upload\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"dubbo\":\"2.0.2\",\"interface\":\"com.erahub.base.basicservice.api.RemoteFileService\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"generic\":\"false\",\"metadata-type\":\"remote\",\"application\":\"erahub-base\",\"background\":\"false\",\"dynamic\":\"true\",\"anyhost\":\"true\"},\"path\":\"com.erahub.base.basicservice.api.RemoteFileService\",\"port\":20880,\"protocol\":\"dubbo\"},\"com.erahub.base.basicservice.api.RemoteMailService:dubbo\":{\"name\":\"com.erahub.base.basicservice.api.RemoteMailService\",\"params\":{\"side\":\"provider\",\"release\":\"3.1.4\",\"methods\":\"send,send,send,sendWithAttachment\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"dubbo\":\"2.0.2\",\"interface\":\"com.erahub.base.basicservice.api.RemoteMailService\",\"service-name-mapping\":\"true\",\"register-mode\":\"insta